const MovesStyle = createGlobalStyle`
    .moves-container {
        height: 40vw;
        width: 20vw;
        background-color: var(--light-grey);
        margin-left: 5vw;
        border-radius: 5%;
    }
`

function Moves({ moves }) {

    let i = 0;
    const moveItems = moves.map(move => {
        return <li key={`move${i}`}>{move[0]} {move[1]}</li>;
        i += 1;
        // console.log(move)
    });
